import React from 'react';

export const Momentum = () => {
    return (
        <div>
            <h2>Momentum Loans</h2>
            <ul>
                <li>Variable Images</li>
                <li>Click to Call and Click to mail</li>
                <li>View in browser link</li>
            </ul>
        </div>  
    )
}

export const ERates = () => {
    return (
        <div>
            <h2>eRates Mortgage</h2>
            <ul>
                <li>Tested in all email clients and devices</li>
                <li>Mobile Responsive</li>
            </ul>
        </div>  
    )
}

export const NA = () => {
    return (
        <div>
            <h2>North American Mortgage Company</h2>
            <ul>
                <li>Custom branded designs</li>
                <li>Dynamic messaging content</li>
            </ul>
        </div>  
    )
}
